```php
<?php

trait MyTrait
{
    /**
     * @return static
     */
    public function myMethod()
    {
        $value = parent::myMethod();

        // ...

        return $value;
    }
}

/**
 * @psalm-consistent-constructor
 */
class MyParentClass
{
    /**
     * @return static
     */
    public function myMethod()
    {
        return new static();
    }
}

class MyChildClass extends MyParentClass
{
    use MyTrait;
}
```

